import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Statistics from './screens/Statistics';
import Game from './screens/Game';
import ResultModal from './screens/ResultModal';

export default function App() {
  const MainStack = createNativeStackNavigator();

  function MainStackScreen() {
    return (
      <MainStack.Navigator>
        <MainStack.Screen name='Game Screen' component={Game} />
        <MainStack.Screen name='Statics Screen' component={Statistics} />
      </MainStack.Navigator>
    );
  }
  const RootStack = createNativeStackNavigator();

  return (
    <NavigationContainer>
      <RootStack.Navigator mode='modal' headerMode='none'>
        <RootStack.Screen name='Result Modal' component={ResultModal} />
        <RootStack.Screen name='Main' componant={MainStackScreen} />
      </RootStack.Navigator>
    </NavigationContainer>
  );
}
